import React, {useRef, useState, useEffect, forwardRef} from "react";


import '../Css/ListaDeGatos.css';
import GatoFormulario from "./GatoFormulario";

function ListaDeGatos(props, ref){

  const [textoG, setTextoG] = useState([]);
  const referencia = useRef(null);
  const [mountedT, setMountedT] = useState(false);

  useEffect(() => {
    if(referencia.current && mountedT === true){
      console.log("aaa");
      referencia.current.scrollTop = referencia.current.scrollHeight;
    };
  }, [textoG, mountedT]);


  const [claseGato, setClaseGato] = useState("");
  const [mountedClase, setMountedClase] = useState(false);
  const claseAsesino = () => {
    setClaseGato("Asesino");
  };
  const claseGuerrero = () => {
    setClaseGato("Guerrero");
  };
  const claseHealer = () => {
    setClaseGato("Healer");
  };
  const claseMago = () => {
    setClaseGato("Mago");
  };
  const claseTanque = () => {
    setClaseGato("Tanque");
  };

  const [armaGato, setArmaGato] = useState("");
  const [mountedArma, setMountedArma] = useState(false);
  const armaDaga = () => {
    setArmaGato("Daga");
  };
  const armaEspada = () => {
    setArmaGato("Espada");
  };
  const armaArco = () => {
    setArmaGato("Arco");
  };
  const armaBaculo = () => {
    setArmaGato("Baculo");
  };
  const armaMandoble = () => {
    setArmaGato("Mandoble");
  };
  useEffect(() => {
    if(mountedClase === true && mountedArma === true){
      console.log("Se ha creado un Gato " + claseGato + " con " + armaGato);
      setMountedT(false);
      setMountedClase(false);
      setMountedArma(false);
    }
  }, [claseGato, armaGato, mountedClase, mountedArma])


  const crearGato = () => {
    if(claseGato !== "" && armaGato !== ""){
      setTextoG("NOMBRE-RANDOM");
      setMountedT(true);
      setMountedArma(true);
      setMountedClase(true);
    };
  };

  return(
    <div className="gato-rpg">
      <div className="contenedor-caracteristicas">
        <GatoFormulario/>
        <div>
          <label>Clase: </label>
          <button onClick={claseAsesino}>Asesino</button>
          <button onClick={claseGuerrero}>Guerrero</button>
          <button onClick={claseHealer}>Healer</button>
          <button onClick={claseMago}>Mago</button>
          <button onClick={claseTanque}>Tanque</button>
        </div>
        <div>
          <label>Arma: </label>
          <button onClick={armaDaga}>Dagas</button>
          <button onClick={armaEspada}>Espada</button>
          <button onClick={armaArco}>Arco</button>
          <button onClick={armaBaculo}>Baculo</button>
          <button onClick={armaMandoble}>Mandoble</button>
        </div>
        <div>
          <button onClick={crearGato}>Crear</button>
        </div>
      </div>
      <div
      className="contenedor-lista"
      ref={referencia}>
        <div
        className="contenedor-gatos">
          {props.textoG}
        </div>
        <div
        className="contenedor-gatos">
          {props.textoG}
        </div>
        <div
        className="contenedor-gatos">
          {props.textoG}
        </div>
        <div
        className="contenedor-gatos">
          {props.textoG}
        </div>
      </div>
  </div>
  );
};

export default forwardRef(ListaDeGatos);
